// SymptomsButtons.js
import React from 'react';
import ActionProvider from './ActionProvider';


const button = ({ buttons, setState }) => {
  return (
    <div>
      {buttons.map(button => (
        <button
          key={button.value}
          onClick={() => {
            const actionProvider = new ActionProvider("createChatBotMessage", setState);
            actionProvider.handleSymptomSelection(button.value);
          }}
        >
          {button.label}
        </button>
      ))}
    </div>
  );
}

export default button;
